import React from "react";
import Search from "../common/search";
import { Alert } from "antd";
import { useStore } from "../../util/store/mycontext";
import "./home.scss";

function Home() {
  const utilStore = useStore().utilStore;

  return (
    <div className="home">
      {utilStore.alertMsg.length > 0 && (
        <Alert message={utilStore.alertMsg} type="error" />
      )}

      <Search
        placeholder={"Search for a movie, tv show, ..."}
        inputValue={""}
      />
    </div>
  );
}

export default Home;
